import axios from "axios";
import React, { useEffect, componentDidMount } from "react";

import "./styles.css";

const Posts = () => {
  componentDidMount(() => {
    axios.get("http://localhost:5000/posts").then((response) => {
      const posts = response.data;
      console.log(posts);
    });
  });

  return <div className="Posts"></div>;
};

export default Posts;
